        context.connection()
            .switch(live ? keys[1] : keys[0]);

        context.enter(iD.modes.Browse(context));
        context.flush();

        d3.select(this)
            .text(live ? t('source_switch.dev') : t('source_switch.live'))
            .classed('live', !live);
